import React from 'react';
import { NavLink } from 'react-router-dom';
import './Navbar.scss';

const Navbar = () => {
  return (
    <div className="head">
      <span className="head-title">POSTS </span>
      <div className="l-wrap">
        <NavLink className="user" exact to="/">
          Home
        </NavLink>
        <NavLink className="user" exact to="/post">
          Posts
        </NavLink>
        <NavLink className="user" exact to="/signup">
          Singup
        </NavLink>
        <NavLink className="user" exact to="/Login">
          Login
        </NavLink>
        <span className="user">Hi, Pankaj</span>
      </div>
    </div>
  );
};

export default Navbar;
